export const getEvents = (location) => {
    var myHeaders = new Headers();
    myHeaders.append("Access-Control-Allow-Origin", "http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2");
    return fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location=paris", {
        method: "GET"
    }).then((res) => {
        return res.json();
    }).catch((err) => {
        console.log(err);
    });
}
